import React from "react";

export default function HistorialState(){
    return(
        <div>
            <div className="grid-historial">
                <div className="historial-style">4</div>
                <div className="historial-style2">SQM</div>
                <div className="historial-style3">100</div>
                <div className="historial-style4">$500</div>
                <div className="historial-style5">Venta</div>
                <div className="historial-style6">Realizada</div>
                <div className="historial-style7">10/12/2022</div>
            </div>
        </div>
    )
}
